function Button(){

  let count= 0;

  const handleclick = (name) => {
    if(count<3){
      count++;
      console.log(`${name}you clicked me${count} time` )
    }
    else{
      console.log(`${name} stop calling me`)
    }
  }
  return (
    <div>
      <button onClick={handleclick}>Click me</button>
    </div>
  )
}

export default Button
